import { Outlet } from "react-router-dom";
import { Playder, SidebarLeft, SidebarRight } from "../../components";

const Public = () => {
  return (
    <div className="w-full flex min-h-screen flex-col bg-[#170f23]">
      <div className="w-full flex flex-auto h-full">
        <div className="w-[240px] flex-none">
          <SidebarLeft />
        </div>
        <div className="flex-auto">
          <Outlet />
        </div>
        <div className="w-[329px] flex-none hidden">
          <SidebarRight />
        </div>
      </div>
      <div className="h-[90px] flex-none bg-[#130c1c] bod">
        <Playder />
      </div>
    </div>
  );
};

export default Public;
